(742, 1291, 126, 2, 'torpedo-belaz.by', 51, '1', 'http://www.torpedo-belaz.by/wp-login.php', 'bystropost', '159357159357159357', 'футбол', 0, 0, 0, '', 'Новости не должны касаться ФК "Торпедо-Белаз"\n\nПосле статьи тег "hr" и уже под ним постовой. Если хочет вверху постовой, то ставим вверху, но тогда заполняем поле "цитата" чтобы анонс начинался со статьи а не с его постового. \n\nКартинке прописываем альт тайтл текст и подпись такие же как название статьи. Картинка ставится перед статьёй. Всего минимум 4 абзаца в статье. После добавления статьи переходим в режим html и убеждаемся, что нет никакого мусора там. Меток нет. Ссылки у картинки нет, т.е. картинка не является ссылкой.\n\nСтатьи только о спорте! Рерайт новостей или статей. Публикация только в раздел "калейдоскоп"!. Ссылка на эту рубрику есть на главной.\n\nАбзаца разделены пустой строкой в режиме HTML никаких тегов "p" и "br"\n\nПро покер и казино - можно.\n\nтолько новые статьи', 1, 240, 180, 'left', 40, 5, 67, 50, 67, 50, 120, 105, 30, 15, 67, 50, 67, 50, 55, 42, 0, '2012-10-11', 0, 1);
