(743, 1290, 126, 2, 'pochitat-knigu.ru', 149, '1', 'http://pochitat-knigu.ru/wp-login.php', 'bystropost', '159357159357159357', 'Литература', 0, 0, 0, '', 'Для размещения постовых использовать специальное поле (в режиме редактирования внизу под редактированием статьи блок "постовой") туда вставляется постовой в html с околоссылочным текстом, если конечно оптимизатор не пожелал без выделения всё делать. Если пожелал без выделения, то после статьи тег "hr" и уже под ним постовой. Если хочет вверху постовой, то ставим вверху, но тогда заполняем поле "цитата" чтобы анонс начинался со статьи а не с его постового. \n\nКартинке прописываем альт тайтл текст без подписи такие же как название статьи. Картинка ставится перед статьёй. Всего минимум 4 абзаца в статье. После добавления статьи переходим в режим html и убеждаемся, что нет никакого мусора там. Затем проставляем метки статьи меткой служит фамилия автора книги о которой рецензия. Ссылки у картинки нет, т.е. картинка не является ссылкой.\n\nВ настройках кастом панели выбираем Sidebar Option - самый последний (четвёртый), Post Image и Feature Image вставляем урл картинки из статьи.\n\nСтатьи в основном - рерайт рецензий на книги. Публикация в раздел "рецензии читателей"\n\nАбзаца разделены пустой строкой в режиме HTML никаких тегов "p" и "br"\n\nПро покер и казино - можно.\n\nВ гогетлинкс - только новые статьи\nВ гетгудлинкс можно старые уже проиндексированные гуглом.', 1, 240, 180, 'left', 30, 1, 67, 50, 67, 50, 120, 105, 30, 15, 67, 50, 67, 50, 55, 42, 0, '2012-10-11', 0, 1),
