(745, 1288, 126, 2, 'zhodino.by', 5, '1', 'http://www.zhodino.by/wp-login.php', 'bystropost', '159357159357159357', 'СМИ', 0, 0, 0, '', 'Все статьи публикуются только в рубрике "Калейдоскоп "\n\nДля размещения постовых использовать специальное поле (в режиме редактирования внизу под редактированием статьи блок "постовой") туда вставляется постовой в html с околоссылочным текстом, если конечно оптимизатор не пожелал без выделения всё делать. Если пожелал без выделения, то после статьи тег "hr" и уже под ним постовой. Если хочет вверху постовой, то ставим вверху, после постового "hr" но тогда заполняем поле "цитата" чтобы анонс начинался со статьи а не с его постового. \n\nКартинки прописываем альт тайтл текст и подпись такие же как название статьи. Всего минимум 4 абзаца в статье. После добавления статьи переходим в режим html и убеждаемся, что нет никакого мусора там. Затем проставляем метки статьи (подходящие покажет плагин - берём Подходящие из локальные метки). Ссылки у картинки нет, т.е. картинка не является ссылкой.\n\nСтатьи в основном - рерайт новостей любых кроме политики.\n\nАбзаца разделены пустой строкой в режиме HTML никаких тегов "p" и "br"\n\nЕсли есть ограничение по максимуму внутряков и система не принимает по этому параметру статью, то в сайдбаре админки справа от редактора статьи есть блок Single Post Template, там выбираем другой шаблон и обновляем статью = минимальное количество внутряков получится.\n\nПро покер и казино - можно.', 1, 240, 180, 'left', 50, 3, 67, 50, 67, 50, 120, 105, 30, 15, 67, 50, 67, 50, 55, 42, 0, '2012-10-11', 0, 1),
(746, 1287, 126, 2, 'pochesnomu.ru', 41, '1', 'http://pochesnomu.ru/wp-login.php', 'bystropost', '159357159357159357', 'SEO, маркетинг', 0, 0, 0, '', 'Для особо одарённых записал видио инструкцию по работе с площадкой менее чем на 5 минут, не поленитесь - гляньте http://uss.su/faq.mp4\n\nДля размещения постовых использовать специальное поле (в режиме редактирования внизу под редактированием статьи блок "постовой") туда вставляется постовой в html с околоссылочным текстом, если конечно оптимизатор не пожелал без выделения всё делать. Если пожелал без выделения, то после статьи тег "hr"  и уже под ним постовой. Если хочет вверху постовой, то ставим вверху, после постового "hr" но тогда заполняем поле "цитата" чтобы анонс начинался со статьи а не с его постового. \n\nКартинки прописываем альт тайтл текст и подпись такие же как название статьи. Картинка ставится после второго абзаца перед третьим. Всего минимум 4 абзаца в статье. После добавления статьи переходим в режим html и убеждаемся, что нет никакого мусора там. Затем проставляем метки статьи (подходящие покажет плагин - берём Подходящие из локальные метки). Ссылки у картинки нет, т.е. картинка не является ссылкой.\n\nСтатьи в основном - рерайт новостей с сеоньюс http://www.seonews.ru/events/.\n\nЕсли в статье есть список чего-то, то используем список "ul" "ol" "li"? если после этого на картинку залазят пункты списка, то картинку можно выровнять по правому краю, как тут http://pochesnomu.ru/seo-kak-marketing-v-internete/\n\nАбзаца разделены пустой строкой в режиме HTML никаких тегов "p" и "br"\n\nПро покер и казино - можно.', 1, 240, 180, 'left', 30, 2, 67, 50, 67, 50, 120, 105, 30, 15, 67, 50, 67, 50, 55, 42, 0, '2012-10-11', 0, 1),
