(794, 1307, 150, 2, 'oldmerin.net', 80, '3', 'http://oldmerin.net/admin.php?mod=main', 'bystropost', 'bystropost19', '', 1, 1, 0, '', 'Ширина изображения указана для анонса статьи. Текст анонса справа от изображения.\nВсе ваши статьи под ГГЛ будут в категории "Разные статьи" mixed_articles\nДля всех бирж, кроме миралинкс статьи надо постить туда же.\n\nДля миралинкс: \nРазмещаем статьи в разделе "Автомобили1", когда наберется 30, начинаем раздел "Автомобили2" и так далее.', 1, 150, 120, 'left', 230, 4, 55, 42, 55, 42, 120, 105, 30, 15, 55, 42, 55, 42, 55, 42, 0, '2012-10-19', 0, 1),
