(800, 0, 156, 142, 'gadge.ru', 139, '1', 'gadge.ru/wp-admin/', 'admin', 'f%3wT3h?f', 'Hi-tech, Гаджеты', 1, 1, 0, '', 'Размещать исключительно в старом контенте, если это позволяет сделать задание. Ищем тут - http://yandex.ru/yandsearch?text=host:gadge.ru+|+host:www.gadge.ru&lr=2\nНе публиковать в последних записях, чтобы в каждой записи на главной не были продажные ссылки!\n\nЕсли задание публиковать в непроиндексированных, то берём запись из черновиков и пишем внизу заметку соответсвенную.', 1, 204, 204, 'left', 130, 3, 30, 15, 30, 15, 120, 60, 30, 15, 30, 15, 30, 15, 30, 15, 0, '2012-10-21', 0, 1),
(801, 0, 157, 142, 'healyou.ru', 85, '1', 'http://healyou.ru/wp-admin', 'admin', '123456', '', 1, 1, 0, '', 'Статьи добавляйте в разные категории, чтобы равномерно они распределялись. Надеюсь за качеством и количеством контента будете следить. Картинки очень большие не добавляйте (то есть, если картинка большая, то размер можно оставить, но в теге img уменьшить ширину и высоту) Для меня важно не только заработать, но и сохранить сайт. Для вас, я полагаю, тоже.', 1, 300, 200, 'center', 10, 1, 45, 30, 45, 30, 120, 105, 30, 15, 45, 30, 45, 30, 30, 15, 0, '2012-10-21', 0, 1),
(802, 0, 158, 142, 'aqua-shrimp.ru', 29, '2', 'http://aqua-shrimp.ru/user/login', 'Delgado', 'fd2kV3z', 'Креветки', 0, 1, 0, '', 'Страница со статьями для публикации обзоров: http://aqua-shrimp.ru/publ (в некоторых статьях уже есть обзоры, но их немного, три-четыре статьи), в статье http://aqua-shrimp.ru/publ/mikropetsiliya-brannera есть контекстная ссылка.\nДля публикации обзора надо перейти на страницу с полным материалом и нажать Редактировать (вверху). Публикация в поле Постовой.\nРабота в текущем контенте', 0, 0, 0, 'left', 120, 3, 30, 15, 30, 15, 120, 60, 30, 15, 30, 15, 30, 15, 30, 15, 0, '2012-10-21', 0, 1),
