(806, 1310, 151, 2, 'nikonfan.ru', 65, '1', 'http://nikonfan.ru/wp-admin', 'admin', '8g6Hc63kVv9cp', 'Фотография', 0, 0, 0, '', 'ВНИМАНИЕ!!! Все описанные ниже условия обязательны!\n\nВыбирайте, пожалуйста, категорию правильно. Если заметка о фото, то категория "Заметки о фото", если пишите о чем-то креативном в фотографии, то рубрика "Креатив" и т.д. Важно качество текста, читатели ведь реальные ;)\nЗаметки размещаем под новостью с пометкой "Объявление:".\nВ блоге установлен плагин маскировки ссылок (rel="nofollow" и noindex), не забывайте отключать его при публикации, включив опцию "Не маскировать ссылки".\nОбязательно прописывать 2-3 метки к публикации.\nИзображения загружаем в блоке "faster Insert", который находится под окном редактора.\nСпасибо!', 1, 450, 300, 'center', 20, 1, 62, 48, 62, 48, 120, 105, 30, 15, 62, 48, 62, 48, 50, 40, 0, '2012-10-23', 0, 1),
(807, 1311, 151, 2, 'pervushin.com', 41, '1', 'http://pervushin.com/wp-admin/', 'newsmaker', 'bKkf87Cuv', '', 0, 0, 0, '', 'ВНИМАНИЕ!!! Все описанные ниже условия обязательны!\n\nВсе публикации отправляем только в категорию "НОВОСТИ". Из названия рубрика понятно, что требуются НОВОСТИ на тему: интернет, seo, smo, социальные сети, маркетинг, PR, интернет-сервисы, интернет-деятели и т.д.\nЗаметки размещаем под новостью с пометкой "Объявление:".\nВ блоге установлен плагин маскировки ссылок (rel="nofollow" и noindex), не забывайте отключать его при публикации, включив опцию "Не маскировать ссылки".\nОбязательно прописывать 2-3 метки к публикации.\nИзображения загружаем в блоке "faster Insert", который находится под окном редактора.\nСпасибо!', 1, 450, 250, 'center', 300, 3, 79, 58, 79, 58, 120, 105, 30, 15, 79, 58, 79, 58, 55, 42, 0, '2012-10-23', 0, 0),
