(1, 'Miko', '', 'Доволен работой Анатолия! Начали сотрудничество не так давно, и нареканий не имею! Человек знает свое дело и делает его с качеством, появилось больше свободного времени, спасибо еще раз Вам :)', '2012-09-02', , 1),
(2, 'Serfer77', '', 'Работаю с Анатолием уже несколько месяцев - полностью передал ему работу по заявкам в биржах по десятку сайтов. \nС тех пор забыл что это такое - монотонная работа по обработке заявок в биржах, Анатолий справляется отлично, заявки выполняются действительно быстро, тексты хорошие. Рекомендую.\nА у меня освободилось время на другие важные задачи...', '2012-09-02', , 1);
