INSERT INTO `tkmsgs` (`id`, `ticket`, `reply`, `owner`, `sender`, `recipient`, `text`, `date`) VALUES
(1, 1, 0, 114, 114, 2, 'Здравствуйте. А почему вы перестали размещать картинки в статьях?', '2012-10-11 00:00:00'),
(2, 2, 0, 96, 96, 0, 'Здравствуйте. Вчера произвел оплату на свой аккаунт с вмд 131336941953 в размере 200 рублей. Но поторопился и перепутал ВМД ( надо было отправить деньги с 227311555802) .Соответственно деньги не пришли. Если что то можно сделать чтобы вернуть деньги на аккаунт буду очень признателен', '2012-10-11 00:00:00'),
(8, 2, 2, 96, 1, 96, 'Здравствуйте, ещё вчера я всё проверил, забыл сообщить. Баланс к вам начислился ведь, 3 заявки вы успели оплатить. Так что ведь хорошо?', '2012-10-13 00:00:00'),
(9, 6, 0, 96, 96, 0, 'Нет уже был правильный перевод с вмд 227311555802 которого нужно. А перед этим платеж был с другого вмд', '2012-10-13 00:00:00'),
(10, 1, 1, 114, 2, 114, 'Здравствуйте, проблема я так понимаю устранена?', '2012-10-13 00:00:00'),
(11, 7, 0, 108, 108, 0, 'не вытягивает площадки с GetGoodLinks', '2012-10-13 00:00:00'),
(12, 7, 11, 108, 1, 108, 'Вам нужно было указать логин не sacred, а iliadin79@gmail.com . Я сделал это, 2 площадки успешно импортировались.', '2012-10-13 00:00:00'),
(31, 6, 9, 96, 1, 96, 'Ответьте в данном тикете нормально. С какого кошелька вы пополнили удачно в системе быстропост баланс, а с какого кошелька не получилось.\nИменно номера кошельков назовите.', '2012-10-16 00:00:00'),
(26, 15, 0, 57, 57, 0, 'getgoodlinks.ru сообщает что есть еще одно невыполненное задание - а система его не подхватывает пока.', '2012-10-16 00:00:00'),
(32, 15, 26, 57, 1, 57, 'А как вы поняли что система его не подхватывает?', '2012-10-16 00:00:00'),
(14, 9, 0, 30, 30, 0, 'Пополнил баланс на 2 тысячи деньги на счету не появились!', '2012-10-14 00:00:00'),
(62, 23, 57, 22, 1, 22, 'Сделано.\nТикет закрытТикет закрыт!', '2012-10-22 00:00:00'),
(63, 26, 0, 150, 150, 2, 'Приветствую. \nВ описании сайта я написал, куда постить миру, но статью положили в общую ленту. Прошу прочитать и делать как там написано.', '2012-10-22 00:00:00'),
(24, 13, 21, 12, 1, 12, 'Закроем всё сегодня.Тикет закрыт!', '2012-10-16 00:00:00'),
(16, 9, 14, 30, 1, 30, 'Здравствуйте.\nWMID в профиле не соответствовал WMID с которого вы пополнили деньги\nСейчас я поставил туда ваш wmid с которого вы оплатили. Больше проблем не будет.\nБаланс начислен.', '2012-10-14 00:00:00'),
(66, 29, 0, 28, 28, 2, 'Здравствуйте. Обзор http://perec-festival.ru/vasha-buhgalteriya-kak-po-notam из PR.Sape цена на бирже 162 рубля, но цена неверна, её стоимость 300 рублей http://floomby.ru/s1/SchkM/full/ и почему стоимость выполнения 120 рублей?\n\nИ почему обзор выполнен, если заявка была автоматически отклонена по истечению срока? http://floomby.ru/s1/6chZG/full/', '2012-10-23 00:00:00'),
(21, 13, 0, 12, 12, 0, 'Через 18ч на бирже gogetlinks сгорят заявки', '2012-10-16 00:00:00'),
(19, 1, 10, 114, 114, 2, 'Нет. Я говорю про сайт http://dalinika.ru/. Раньше вы размещали статьи с картинками, но потом стали без картинок.', '2012-10-15 00:00:00'),
(28, 7, 11, 108, 1, 108, 'Тикет закрыт!', '2012-10-16 00:00:00'),
(29, 2, 2, 96, 1, 96, 'Тикет закрыт!', '2012-10-16 00:00:00'),
(25, 9, 14, 30, 1, 30, 'Тикет закрыт!', '2012-10-16 00:00:00'),
(33, 6, 31, 96, 96, 0, 'Удачно прошла проплата с кошелька R756049081465, не прошла оплата 10.10.2012 с кошелька R114576852106', '2012-10-16 00:00:00'),
(34, 16, 0, 114, 114, 2, 'А почему цена на некоторые статьи 60 рублей? В чем разница от 55 руб ?', '2012-10-17 00:00:00'),
(35, 16, 34, 114, 1, 114, 'Здравствуйте. Проблема решается. Заявки по 60 рублей, платить не надо. Похоже на ошибку.', '2012-10-17 00:00:00'),
(36, 15, 32, 57, 57, 0, 'Зайдя в систему и получая уведомления:\nВнимание! У вас есть необработанные предложения от оптимизаторов (3 шт.)\n\nПросьба это исправить в скорейшие сроки - или я буду вынужден выполнять эти заявки самостоятельно, и тогда смысл в сервисе исчезнет.', '2012-10-17 00:00:00'),
(38, 6, 33, 96, 1, 96, 'Я зачислил вам 200 рублей.\nПриношу свои извинения за длительность моих действий.Тикет закрыт!', '2012-10-18 00:00:00'),
(39, 15, 36, 57, 1, 57, 'Здравствуйте. Рейтинг по площадке у вас 1 сутки и 1.3 суток. Что является не плохим результатом. По сайту http://maranatha.org.ua/ заявка будет выполнена уже совсем скоро. Советую проверять ещё аккаунт т.к письма которые отправляет гогетлинкс совсем не мгновенные.Тикет закрыт!', '2012-10-18 00:00:00'),
(40, 18, 0, 49, 49, 2, 'Здравствуйте. Задания в ротапосте не выполняются. Заявки в этом месяце как раньше в ротапосте еще не рассылались.', '2012-10-18 00:00:00'),
(41, 1, 19, 114, 1, 114, 'Проблему нашли, теперь будет всё с картинками. Если повторится - создайте тикет снова. Можете скинуть список урлов за последнее время - проставим картинки.Тикет закрыт!', '2012-10-18 00:00:00'),
(43, 18, 40, 49, 1, 49, 'Здравствуйте, была проблема с паролем оказывается. спец.символы исковеркались и работа встала...только сейчас подправили. Вам стоило бы раньше сказать..хотя сам понимаю, что это тоже наша вина. Более не повторится. Лимиты разошлем по всем возможным.Тикет закрыт!', '2012-10-18 00:00:00'),
(44, 20, 0, 49, 49, 2, 'Здравствуйте.\n\nС Ротопостом ситуация пока не изменилась. Время заявок истекает, некоторые уже истекли. \n\n\nБолее ранняя переписка:\n\nОтвет на сообщение: №40\nЗдравствуйте, была проблема с паролем оказывается. спец.символы исковеркались и работа встала...только сейчас подправили. Вам стоило бы раньше сказать..хотя сам понимаю, что это тоже наша вина. Более не повторится. Лимиты разошлем по всем возможным.Тикет закрыт!\n\n40 18 октября 2012 г.  Здравствуйте. Задания в ротапосте не выполняются. Заявки в этом месяце как раньше в ротапосте еще не рассылались.', '2012-10-19 00:00:00'),
