(50, 16, 35, 114, 114, 0, 'Мне пришло письмо, что аккаунт заблокирован по причине задолжности, т.к. задания по 60 рублей я не оплачивал.', '2012-10-22 00:00:00'),
(51, 16, 50, 114, 1, 114, 'Аккаунт не блокировался.\nОтправьте пожалуйста текст письма который вам пришел.\n\nБыла рассылка тем, у кого заявка более 5 дней. Уведомление. Без блокировок..\n\nСтоимость за заявки, я сейчас исправлю.', '2012-10-22 00:00:00'),
(52, 16, 51, 114, 114, 0, 'Здравствуйте, whitekreved@gmail.com\n\nУ Вас есть неоплаченные заявки за 5 дня(-ей).\n\nНапоминаем Вам. Если у Вас будут неоплаченные заявки старше 5 дней (включительно) то Ваш аккаун будет заблокирован до полного погашения задолженности.\n\nВНИМАНИЕ! Ваш аккаунт заблокирован по причине задолженности. Оплатите завершенные работы от 5 дней (включительно) для разблокировки.\n\nСпасибо, что пользуетесь нашим сайтом!\n\n\nС уважением, www.Bystropost.ru', '2012-10-22 00:00:00'),
(53, 16, 52, 114, 1, 114, 'Спасибо. Значит ушел и информативный текст и о блокировке за компанию.. не хорошо получилось.\nЦены за заявки исправил. Более не должно повторится. Тикет закрываю..Тикет закрыт!', '2012-10-22 00:00:00'),
(54, 23, 0, 22, 22, 2, 'Здравствуйте, сегодня пришло на почту письмо о блокировке аккаунта.\nБыла не оплачена более 5-ти заявка, которая уже 4-й день висит в ГГЛ на доработке. Сейчас я конечно же ее оплатил, чтобы разблокировать акк, но все равно получается как-то нелогично оплачивать работу, которая не принята оптимизатором.\nЕсть также предложение для администрации - чтобы оплата происходила автоматически при принятии размещенного обзора оптимизатором.', '2012-10-22 00:00:00'),
(55, 23, 54, 22, 1, 22, 'Здравствуйте. Был небольшой сбой в рассылке. Нужно было проинформировать, а не высылать ещё текст о блокировке. Аккаунты не блокировались.\n\nПо заявке -\nВ быстропост сдаются те заявки, которые были отправлены оптимизаторам. Доработки делаются, если по каким-то причинам задание с доработки не выполняется, то на его место всегда будет использовано другое задание. Статья ведь написана. За лишнее не кто не платит.\n\nДоработку сегодня точно сделают.', '2012-10-22 00:00:00'),
(56, 23, 54, 22, 1, 22, 'Вы подтверждаете требование оптимизатора?\n\n"Здравствуйте! Согласно моему заданию ссылка должна располагаться в первом абзаце обзора, либо сразу после первого абзаца обзора. Прошу Вас перенести ссылку выше. "\n\nИз-за таких вот доработок, паузы и возникают. Т.к не знаем, можно ли нам нарушать стилистику публикации..', '2012-10-22 00:00:00'),
(57, 23, 56, 22, 22, 0, 'Да, потверждаю.', '2012-10-22 00:00:00'),
(58, 24, 0, 42, 42, 2, 'Я уезжаю на 4-ре недели и возможно не буду у компьютера по 3-5 дней. Я пополнил счёт, но кто будет для заявок оплату нажжимать, что бы аккаунт не блокировался?', '2012-10-22 00:00:00'),
