(70, 30, 0, 108, 108, 0, 'Приветствую.\nОплатил все сделанные задания, но потом изучил их подробнее и стало не совсем понятно ценообразование\n1. Для площадки shooltz.ru (тиц 90) задания сделаны за 74 рубля, хотя в них до 2000 символов. Получается должно быть 55+12 = 67 рублей\n2. Для других сайтов (тиц 10-20) в "дополнительных услугах" выставил (несколько дней назад) от 1000 до 1499 символов - но всё равно задания делаются за 62 рубля, а не за 50', '2012-10-24 00:00:00'),
