(72, 29, 66, 28, 1, 28, 'Здравствуйте.\nЭто глюк от pr.sape т.к мы используем не основной, а гостевой доступ в системе. Нам отдали одну цену, а на деле оказалась другая. Решение лишь одно - давать основной доступ к аккаунту.', '2012-10-24 00:00:00'),
(73, 30, 71, 108, 108, 0, 'Переплата то небольшая (28 рублей вроде выходит). Как в дальнейшем будут оцениваться задания?\nВозможно установить так?:\nshooltz.ru (тиц 90) = 55+12 (>1500 символов) = 67 р.\nkulinaria.if.ua (тиц 10) = 50 р. (1000-1500 символов)\nsea-delicates.ru (тиц 10) = 50 р. (1000-1500 символов)\nblogreal.ru (тиц 20) = 50 р. (1000-1500 символов)', '2012-10-24 00:00:00'),
(74, 30, 71, 108, 108, 0, 'Переплата то небольшая (28 рублей вроде выходит). Как в дальнейшем будут оцениваться задания?\nВозможно установить так?:\nshooltz.ru (тиц 90) = 55+12 (>1500 символов) = 67 р.\nkulinaria.if.ua (тиц 10) = 50 р. (1000-1500 символов)\nsea-delicates.ru (тиц 10) = 50 р. (1000-1500 символов)\nblogreal.ru (тиц 20) = 50 р. (1000-1500 символов)', '2012-10-24 00:00:00'),
