(129, 56, 0, 42, 42, 2, '>http://wel.org.ua/it/новости-it/vy-brat-podarok-dlya-lyubimoj\nПричина отклонения: Некоторые ссылки ведут на тестовый субдомен. В целом текст не похож на отзыв, а скорее на обзор. Я же сразу указал акцент "МОЙ отзыв". А у вас вышло не понять что :(\n\nЗаявка оплатилсь автоматически!', '2012-11-03 10:54:22'),
(130, 56, 129, 42, 1, 42, 'Здравствуйте, а чего вы переживаете? Рядовой случай, задание упало на доработку т.к к обзорам много требований.\nПока он на доработке - он у нас в работе. И мы обязательно доработку сделаем. Так что всё хорошо, вы не зря оплатили обзор. Тикет закрыт.', '2012-11-03 11:59:55'),
