(134, 43, 109, 124, 1, 124, 'Здравствуйте, мы постоянно улучшаем свой сервис. Сегодня качество, лучше чем в конце октября.\nВесь ваш аккаунт в приоритете у нас в работе. \nРейтинг площадок, тоже будет более низким. Иногда, мы делаем пакетное размещение. Но мы придерживаемся рамок оптимального значения, чтобы заявки не отменились. Для нас главное рейтинг площадки. Тикет закрыт.', '2012-11-03 12:09:45'),
