(137, 42, 103, 124, 1, 124, ' Тикет закрыт.', '2012-11-03 12:18:31'),
(138, 41, 102, 124, 1, 124, ' Тикет закрыт.', '2012-11-03 12:18:39'),
(143, 57, 0, 151, 151, 2, 'Да, что касается заявок в GGL. Необходимо просмотреть существующие там сейчас проблемы. \n\nВ частности проблема с обзором для сайта http://www.u-stal.ru/, написали не тематический пост -> отправили его в GGL - > затем пост удалили, но новый не добавили, заявка висит как "404 не найдено", а статью я уже оплатил.\n\nТакже висит две заявки на доработку, здесь их уже требуется оплатить, но оплачивать их не буду, пока не примут работу рекламодатели.\n\nНадеюсь этот фидбек позволит улучшить сервис. Спасибо.', '2012-11-03 14:59:32'),
(140, 35, 104, 124, 1, 124, 'В работе, будет сделано!', '2012-11-03 12:33:38'),
(141, 34, 105, 44, 1, 44, 'Здравствуйте, мы уже решили эту проблему. И добавили дополнительные, отдельные поля в карточку.\nТеперь ошибок, которые были - больше быть не может. Тикет закрыт.', '2012-11-03 12:38:52'),
(142, 48, 136, 151, 151, 0, 'На площадке pervushin.com уже размещать ничего не надо, она работать не будет. Cпасибо за информацию. Тикет закрыт.', '2012-11-03 14:17:14'),
(144, 58, 0, 28, 28, 2, 'В бирже блогокеш пришло сообщение: Пожалуйста, исправьте ошибку: "настойки пустурника" замените на "настойки пустырника"', '2012-11-03 16:52:22'),
(145, 59, 0, 124, 124, 2, 'и снова сгорает заявка на Getgoodlinks', '2012-11-04 13:22:16'),
(146, 60, 0, 124, 124, 2, 'сгорела заявка на Getgoodlinks', '2012-11-05 02:48:42'),
(147, 61, 0, 28, 28, 2, 'Выполните заявку, висит уже 5 дней http://floomby.ru/s1/JP84h/full/', '2012-11-05 15:03:10'),
(148, 60, 146, 124, 2, 124, 'Здравствуйте, ваша площадка была выключена.\nВозможно проблема техническая, площадку включил.\nИзвините за неудобства. Тикет закрыт.', '2012-11-05 18:13:05'),
(149, 59, 145, 124, 2, 124, 'Здравствуйте, ответ в предыдущем тикете. Тикет закрыт.', '2012-11-05 18:13:51'),
(150, 62, 0, 124, 124, 2, 'Дали все доступы до ska4ka.com \nПросим выполнить обзоры на http://getgoodlinks.ru/', '2012-11-05 19:00:41'),
(151, 63, 0, 124, 124, 2, '4487484\n31.10.2012 16:28\nЗаморожено\n+202.40 \nРазмещение статьи 1850060 на площадке ska4ka.com', '2012-11-05 19:29:24'),
(152, 62, 150, 124, 2, 124, 'Здравствуйте, выполним.\nЗаявки уже в работе. Тикет закрыт.', '2012-11-05 19:57:53'),
(153, 63, 151, 124, 2, 124, 'Здравствуйте, пожалуйста не создавайте тикеты по каждой заявке.\nЕсли добавили новый сайт, то он автоматически уйдет в работу.\nСозданный вами тикет не ускорит процесс выполнения задания. Тикет закрыт.', '2012-11-05 20:00:03'),
(154, 35, 83, 124, 2, 124, 'Здравствуйте, в карточке сайта сделали специальные поля для указания категории под каждую биржу.\nПожалуйста, используйте их для новых сайтов, тогда не будет возникать проблемы с неправильным размещением публикуемых материалов. Тикет закрыт.', '2012-11-05 20:13:26'),
(155, 61, 147, 28, 2, 28, 'Здравствуйте, задание сделаем.\nВ данный момент есть технические трудности, устраняем. Тикет закрыт.', '2012-11-05 21:51:29'),
(156, 64, 0, 93, 93, 2, 'Приветствую. На ggl ожидает доработки постовой уже 5 суток.', '2012-11-05 23:31:38'),
(157, 65, 0, 124, 124, 2, 'заявка номер 21631305\nмы не можем ее оплатить.', '2012-11-06 15:08:46'),
(158, 66, 0, 163, 163, 0, 'Здравствуйте! Почттал в правилах, что вы можете помочь добавить сайт в разные биржи ссылок. Хотел бы попробовать добавить свой блог livvvve.ru в биржи gogetlinks и getgoodlinks, в которые раньее меня не принимали. Вы можете помочь мне в этом?', '2012-11-06 15:35:49'),
(159, 65, 157, 124, 2, 124, 'Здравствуйте, мы не можем вас понять.\nИзлагайте проблему подробно.', '2012-11-06 16:07:41'),
(160, 64, 156, 93, 2, 93, 'Здравствуйте, статью переписываем, заменим. Тикет закрыт.', '2012-11-06 16:11:49'),
(161, 65, 159, 124, 124, 2, 'Тикет висит со стоимостью 0 рублей, и система не позволяет его оплатить.', '2012-11-06 17:05:07');
